import React from 'react';

export class Home extends React.Component {
	render() {
		return (
			<div>
				<h2>Tutorial 10 - APAP</h2>
				<p>Pada tutorial kali ini Anda akan mempelajari bagaimana cara melakukan fetching data (GET dan POST) pada ReactJs app dengan memanfaatkan package <a href="https://reacttraining.com/react-router/web/guides/quick-start">whatwg-fetch</a>. Web Service yang akan digunakan untuk tutorial ini adalah <a href="https://github.com/raziqandri/SI_Appointment">SI Appointment</a>.</p>
				<p>Pada tutorial ini Anda akan menemukan beberapa syntax yang mungkin Anda tidak familiar, seperti deklarasi component secara fungsional serta routing dengan module react-router. Anda tidak perlu mempelajari itu semua pada tutorial kali ini. Namun jika Anda tertarik, Anda dapat mengakses dokumentasinya pada link <a href="https://reacttraining.com/react-router/web/guides/quick-start">ini</a>.</p>
			</div>
		)
	}
}
